import { Component, Input, EventEmitter, Output, OnInit } from '@angular/core';

export interface Announcement {
  title?: string;
  icon?: 'notifications' | 'error' | 'info' | 'success';
}

@Component({
  selector: 'lib-announcement',
  template: `
    <mat-toolbar *ngIf="announcement">
      <div class="container-fluid" style="width:100%;">
        <div class="flex">
          <mat-icon class="mr-2">{{
            announcement.icon || 'notifications'
          }}</mat-icon>
          <div *ngIf="announcement.title">{{ announcement.title }}</div>
          <ng-content></ng-content>
          <div class="grow"></div>
          <div *ngIf="isClosable">
            <button
              mat-icon-button
              aria-label="close"
              (click)="handleCloseClick()"
            >
              <mat-icon>close</mat-icon>
            </button>
          </div>
        </div>
      </div>
    </mat-toolbar>
  `,
  styles: [
    `
      .flex {
        display: flex;
        align-items: center;
        flex-wrap: wrap;
      }
      .grow {
        flex: 1;
      }
      .mat-toolbar {
        background-color: #2d668e;
        color: white;
        white-space: normal;
        height: auto;
        padding: 16px;
      }

      .mr-2 {
        margin-right: 16px;
      }
    `,
  ],
})
export class AnnouncementComponent implements OnInit {
  @Input() announcement?: Announcement;
  @Input() isClosable = true;

  ngOnInit() {
    console.log(this.announcement);
  }

  handleCloseClick() {
    this.announcement = undefined;
  }
}

import { Component, Inject, OnInit } from '@angular/core';
import { Route, Routes } from '@angular/router';
import { MAT_DIALOG_DATA } from '@angular/material/dialog';
import { ActivatedRoute } from '@angular/router';

interface DialogData {
  routes?: Routes;
}

@Component({
  selector: 'lib-mobile-dialog',
  templateUrl: './mobile-dialog.component.html',
  styleUrls: ['./mobile-dialog.component.scss'],
})
export class MobileDialogComponent implements OnInit {
  constructor(
    @Inject(MAT_DIALOG_DATA) public data: DialogData,
    private activeRouter: ActivatedRoute
  ) {}
  public routes?: Routes = this.data.routes;
  ngOnInit(): void {
    this.routes = this.data.routes?.filter(
      (route) => route.data && route.data['menu']
    );
  }

  // @todo do this in a more angular way.
  handleExpandClick(contentClass: string | undefined): void {
    // slide opn and close
    const content = document.querySelector(
      '.content.' + contentClass
    ) as HTMLElement;

    if (content) {
      if (content?.style.maxHeight) {
        content.style.maxHeight = '';
      } else {
        content.style.maxHeight = content?.scrollHeight + 'px';
      }
    }

    // toggle aria attributes
    const collapsible = document.querySelector('.collapsible.' + contentClass);
    if (collapsible) {
      // toggle aria expanded attribute
      if (collapsible.getAttribute('aria-expanded') === 'true') {
        collapsible.setAttribute('aria-expanded', 'false');
      } else {
        collapsible.setAttribute('aria-expanded', 'true');
      }
    }
  }

  handleFocus(contentClass: string | undefined): void {
    const content = document.querySelector(
      '.content.' + contentClass
    ) as HTMLElement;
    if (content) {
      content.style.maxHeight = content?.scrollHeight + 'px';
    }

    const collapsible = document.querySelector('.collapsible.' + contentClass);
    if (collapsible) {
      collapsible.setAttribute('aria-expanded', 'true');
    }
  }

  routeHasActiveChild(route: Route): string {
    const _activeChild = this.activeRouter.children.length;
    if (_activeChild != 0) {
      for (let i = 0; i < _activeChild; i++) {
        if (this.activeRouter.children[i].outlet === 'primary') {
          if (
            this.activeRouter.children[i].snapshot.url[0].path === route.path
          ) {
            return 'active-parent';
          }
        }
      }
    }
    return '';
  }
}

import { Component, Input, OnInit } from '@angular/core';

type AccentOptions =
  | 'blue'
  | 'blue-green'
  | 'gold'
  | 'green'
  | 'purple'
  | 'red';

interface PanelOptions {
  accent?: AccentOptions;
  fill?: boolean;
  heavyTop?: boolean;
  indent?: number;
}

@Component({
  selector: 'lib-alert',
  template: `
    <div class="panel" [ngClass]="generateClassNames()">
      <ng-content></ng-content>
    </div>
  `,
  styleUrls: ['./alert.component.scss'],
})
export class AlertComponent {
  @Input() options!: PanelOptions | undefined;

  generateClassNames() {
    console.log(this.options);
    if (!this.options) {
      return 'panel-default';
    }

    const classNames = [];
    if (this.options.accent) {
      classNames.push(`accent-${this.options.accent}`);
    }
    if (this.options.fill) {
      classNames.push('fill');
    }
    if (this.options.heavyTop) {
      classNames.push('heavy-top');
    }
    if (this.options.indent) {
      classNames.push(`indent${this.options.indent}`);
    }
    return classNames;
  }
}

